import React from "react";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import "./section2.css";

import jsResim from "../Assets/js";
import reactResim from "../Assets/react";
import reduxResim from "../Assets/redux";
import nodeResim from "../Assets/node";
import figmaResim from "../Assets/figma";
import vsResim from "../Assets/vs";

export default function Section1() {
  return (
    <>
      <section className="section2">
        <div className="skills-title">Skills</div>
        <div className="skills-js">
          <img src={jsResim} />
          <span>JAVASCRIPT</span>
        </div>
        <div className="skills-react">
          <img src={jsResim} />
          <span>REACT</span>
        </div>
        <div className="skills-redux">
          <img src={jsResim} />
          <span>REDUX</span>
        </div>
        <div className="skills-node">
          <img src={jsResim} />
          <span>NODE</span>
        </div>
        <div className="skills-vs">
          <img src={jsResim} />
          <span>VS CODE</span>
        </div>
        <div className="skills-figma">
          <img src={jsResim} />
          <span>FIGMA</span>
        </div>
      </section>
    </>
  );
}
